var deployRailwayProvider = function (owner, deployRailwayProviderCallback) {
    railwayProviderContract.new({
        from: owner,
        data: RailwayProviderCompiled.bytecode,
        gas: deployGas
    }, function (e, contract) {
        if (e) {
            console.log("Error creating RailwayProvider contract ", e);
        } else {
            if (!contract.address) {
                console.log('Waiting for RailwayProvider. TransactionHash: ' + contract.transactionHash);
            } else {
                console.log('RailwayProvider contract mined! address: "' + contract.address + '"\n');
                deployRailwayProviderCallback(contract);
            }
        }
    });
};

