var linkContracts = function (railwayProvider, providerStore, reportStore, reviewStore, listReviewStore, roleStore) {

    console.log('Linking contracts ');
    railwayProvider.setRoleContract(roleStore.address, {from: owner, gas: transGas});
    providerStore.setRoleContract(roleStore.address, {from: owner, gas: transGas});
    reportStore.setRoleContract(roleStore.address, {from: owner, gas: transGas});
    reviewStore.setRoleContract(roleStore.address, {from: owner, gas: transGas});
    listReviewStore.setRoleContract(roleStore.address, {from: owner, gas: transGas});
    console.log('RoleStore in RailwayProvider and stores done.');
    railwayProvider.setProviderContract(providerStore.address, {from: owner, gas: transGas});
    railwayProvider.setReportContract(reportStore.address, {from: owner, gas: transGas});
    railwayProvider.setReviewContract(reviewStore.address, {from: owner, gas: transGas});
    railwayProvider.setListReviewContract(listReviewStore.address, {from: owner, gas: transGas});
    console.log('ProviderStore, ReviewStore, ReportStore and ListReviewStore in RailwayProvider done.');
    reportStore.setContractStore(railwayProvider.address, {from: owner, gas: transGas});
    console.log('RailwayProvider in ReportStore done.');
    reviewStore.setContractStore(railwayProvider.address, {from: owner, gas: transGas});
    console.log('RailwayProvider in ReviewStore done.');
    listReviewStore.setContractStore(railwayProvider.address, {from: owner, gas: transGas});
    console.log('RailwayProvider in ListReviewStore done.');

    railwayProviderAddress = railwayProvider.address;
    providerStoreAddress = providerStore.address;
    reportStoreAddress = reportStore.address;
    roleStoreAddress = roleStore.address;
    reviewStoreAddress = reviewStore.address;
    listReviewStoreAddress = listReviewStore.address;

    // Print Info
    info();

};

var deploy = function () {
    console.log('Calling contract creation');
    deployRailwayProvider(owner, function (railwayProvider) {
        console.log('RailwayProvider ready, calling providerStore');
        deployProviderStore(owner, function (providerStore) {
            console.log('providerStore ready, calling reportStore');
            deployReportStore(owner, function (reportStore) {
                console.log('reportStore ready, calling reviewStore');
                deployReviewStore(owner, function (reviewStore) {
                    console.log('reviewStore ready, calling listReviewStore');
                    deployListReviewStore(owner, function (listReviewStore) {
                        console.log('listReviewStore ready, calling roleStore');
                        deployRoleStore(owner, function (roleStore) {
                            console.log('RoleStore ready, calling final config');
                            linkContracts(railwayProvider, providerStore, reportStore, reviewStore, listReviewStore, roleStore);
                        });
                    });
                });
            });
        });
    });
};

