var providerStorePromotions = function (providerStore) {
    console.log('Setting providerStore Promotions ... ');
    providerStore.setPromotion(ProviderAction.Create,               ProviderStatus.Created,                     Actor.PR | Actor.RCC | Actor.RS,    ProviderStatus.Created,                     ProviderStatus.Created, {from:owner, gas: transGas});
    providerStore.setPromotion(ProviderAction.SendEFInformation,    ProviderStatus.Created,                     Actor.RS,                           ProviderStatus.EFInformationSent,           ProviderStatus.EFInformationSent, {from:owner, gas: transGas});
    providerStore.setPromotion(ProviderAction.ReceiveEFInformation, ProviderStatus.EFInformationSent,           Actor.PR | Actor.RS,                ProviderStatus.EFInformationReceived,       ProviderStatus.EFInformationReceived, {from:owner, gas: transGas});
    providerStore.setPromotion(ProviderAction.EFInformationACK,     ProviderStatus.EFInformationReceived,       Actor.RS,                           ProviderStatus.EFInformationACKReceived,    ProviderStatus.EFInformationACKReceived, {from:owner, gas: transGas});
    providerStore.setPromotion(ProviderAction.RequestPRInformation, ProviderStatus.EFInformationACKReceived,    Actor.RS,                           ProviderStatus.PRInformationRequested,      ProviderStatus.PRInformationRequested, {from:owner, gas: transGas});

    providerStore.setPromotion(ProviderAction.SendPRInformation,    ProviderStatus.PRInformationRequested,      Actor.PR | Actor.RS,                ProviderStatus.PRInformationSent,           ProviderStatus.PRInformationSent, {from:owner, gas: transGas});
    providerStore.setPromotion(ProviderAction.ReceivePRInformation, ProviderStatus.PRInformationSent,           Actor.RS,                           ProviderStatus.PRInformationReceived,       ProviderStatus.PRInformationReceived, {from:owner, gas: transGas});
    providerStore.setPromotion(ProviderAction.NotifyRCC,            ProviderStatus.PRInformationReceived,       Actor.RS,                           ProviderStatus.RCCNotified,                 ProviderStatus.RCCNotified, {from:owner, gas: transGas});
    providerStore.setPromotion(ProviderAction.Analyze,              ProviderStatus.RCCNotified,                 Actor.RS,                           ProviderStatus.Analyzing,                   ProviderStatus.Analyzing, {from:owner, gas: transGas});

    providerStore.setPromotion(ProviderAction.Fail,                 ProviderStatus.Analyzing,                   Actor.RS,                           ProviderStatus.Failed,                      ProviderStatus.Failed, {from:owner, gas: transGas});
    providerStore.setPromotion(ProviderAction.NotifyKOPR,           ProviderStatus.Failed,                      Actor.RS,                           ProviderStatus.NotAccepted,                 ProviderStatus.NotAccepted, {from:owner, gas: transGas});

    providerStore.setPromotion(ProviderAction.Pass,                 ProviderStatus.Analyzing,                   Actor.RS,                           ProviderStatus.Passed,                      ProviderStatus.Passed, {from:owner, gas: transGas});
    providerStore.setPromotion(ProviderAction.NotifyOKPR,           ProviderStatus.Passed,                      Actor.RS,                           ProviderStatus.OKPRNotified,                ProviderStatus.OKPRNotified, {from:owner, gas: transGas});
    providerStore.setPromotion(ProviderAction.NofifyOKRCC,          ProviderStatus.OKPRNotified,                Actor.RS,                           ProviderStatus.OKRCCNotified,               ProviderStatus.OKRCCNotified, {from:owner, gas: transGas});
    providerStore.setPromotion(ProviderAction.UpdateProvidersList,  ProviderStatus.OKRCCNotified,               Actor.RCC | Actor.RS,               ProviderStatus.ProvidersListUpdated,        ProviderStatus.ProvidersListUpdated, {from:owner, gas: transGas});
    providerStore.setPromotion(ProviderAction.Accept,               ProviderStatus.ProvidersListUpdated,        Actor.RS,                           ProviderStatus.Accepted,                    ProviderStatus.Accepted, {from:owner, gas: transGas});

    var promo = providerStore.getPromotion(ProviderAction.Accept,  ProviderStatus.ProvidersListUpdated, {from: owner, gas: transGas});
    result = assert(promo[0] == 4, 'Error in setPromotions');
    msg = result.indexOf('PASS') !== -1 ? '--> done.' : result;
    console.log(msg);
};

